import { useState, useEffect } from "react";
import axios from "axios";
import Candidate from "../../components/candidate";

const ManageCandidate = () => {
  let candidateDataArray = [];
  const [candidateData, setCandidateData] = useState("");
  useEffect(() => {
    axios({
      method: "get",
      url: "http://localhost:3001/get-candidate",
      responseType: "json",
    }).then((response) => {
      setCandidateData(response.data.data);
    });
  }, []);

  const objToArray = (parameter) => {
    for (let index = 0; index < parameter.length; index++) {
      const element = parameter[index];

      candidateDataArray.push(element);
    }
  };
  objToArray(candidateData);

  console.log(typeof candidateDataArray);
  return candidateDataArray.map((item) => (
    <Candidate
      name={item.name}
      address={item.address}
      social_number={item.social_number}
      Category={item.Category}
    />
  ));
};

export default ManageCandidate;

import Category from "../../components/Category";
